import { FormControl, FormLabel, VStack } from "@chakra-ui/react";
import React from "react";

const SignUp = () => {
  return (
    <VStack>
      <FormControl>
              <FormLabel> 
                  <Input>
                  </Input>
        </FormLabel>
      </FormControl>
    </VStack>
  );
};

export default SignUp;
